import React,  { Component } from 'react';
import Card from './Card';
import './App.css';

class App extends Component {
  constructor (props) {
    super (props); 

    this.state = {
      cardState : 0
    }
  }

  render () {
    return (
      <div className="className">
          <Card cardState = {this.state.cardState} /> 
      </div>
    );
  }
}

export default App;
